description:
Chris Claremont and Al Milgrom combine forces to bring us this interesting tale of Kitty and Logan together, as it shows how their relationship functions even at this early stage with the X-Men for both. Promotional info -&quot;Kitty travels to Japan to help her father and ends up face-to-face with the granddaddy of all ninjas, Ogun! The man in the dire mask is dead-set on remaking Chicago's favorite mutant teen into an intangible assassin! But Ogun's plans for Kitty's future pale before the role he played in Wolverine's past, and the clawed Canadian vows to bring down his former teacher even if it means his death...or Kitty's!&quot;

